import React from "react";
import { useSelector, useDispatch } from "react-redux";

const App = () => {
  const dispatch = useDispatch();
  const selector = useSelector((state) => state.counter.number);

  return (
    <div>
      {selector}
      <button
        onClick={() => {
          dispatch({ type: "PLUS_ONE" });
        }}
      >
        더하기
      </button>
      <button
        onClick={() => {
          dispatch({ type: "MINUS_ONE" });
        }}
      >
        빼기
      </button>
    </div>
  );
};
